import React from "react";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import Home from "../screens/Home";
import Quiz from "../screens/Quiz";
import MateriMenu from "../screens/MateriMenu";
import About from "../screens/About";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import MaterialCommunityIcons from "react-native-vector-icons/MaterialCommunityIcons";
import { COLORS } from "../constants";
import MateriSatu from "../screens/materi/MateriSatu";

const Stack = createNativeStackNavigator();

function MyStack() {
  return (
    <Stack.Navigator>
      <Stack.Screen name="Main" component={Anu} options={{ headerShown: false }} />
      <Stack.Screen name="Quiz" component={Quiz} options={{ title: "Quiz" }} />
      <Stack.Screen name="MateriMenu" component={MateriMenu} options={{ headerShown: false }} />
      <Stack.Screen name="MateriSatu" component={MateriSatu} options={{ title: "Materi 1" }} />
    </Stack.Navigator>
  );
}
export default MyStack;

const Tab = createBottomTabNavigator();

function Anu() {
  return (
    <Tab.Navigator
      initialRouteName="Feed"
      screenOptions={{
        tabBarActiveTintColor: COLORS.secondary,
      }}
    >
      <Tab.Screen
        name="Home"
        component={Home}
        options={{
          tabBarLabel: "Home",
          tabBarIcon: ({ color, size }) => <MaterialCommunityIcons name="home" color={COLORS.primary} size={size} />,
          headerShown: false,
        }}
      />
      <Tab.Screen
        name="Materi"
        component={MateriMenu}
        options={{
          tabBarLabel: "Materi",
          tabBarIcon: ({ color, size }) => <MaterialCommunityIcons name="newspaper-variant-multiple" color={COLORS.primary} size={size} />,
          // tabBarBadge: 3,
          headerShown: false,
        }}
      />
      <Tab.Screen
        name="About"
        component={About}
        options={{
          tabBarLabel: "About",
          tabBarIcon: ({ color, size }) => <MaterialCommunityIcons name="account" color={COLORS.primary} size={size} />,
          headerShown: false,
        }}
      />
    </Tab.Navigator>
  );
}
